  true,\n\t\"url\": null,\n\t\"notes\": \"The Air Traffic Control Beacon Interrogator
  Model 6 (ATCBI-6) is a ground-based system that interrogates transponders, receives,
  and processes replies from transponders, determines the range and azimuth to the
  aircraft, and forwards the information to appropriate air traffic control (ATC)
  automation systems.  Replies provide identification and altitude data of the transponder.
  \ The ATCBI-6 Replacement Program will procure about 140 Monopulse Secondary Surveillance
  Radar (MSSR) with Selective Interrogation (SI) to replace existing operational beacons,
  which includes four support systems (not shown in the quantities below) for training,
  testing, logistics, and operational support.\",\n\t\"license_title\": \"Other License
